import React from "react";
import Navigation from "../components/Navigation";
import ArticlesContainer from "../components/ArticlesContainer";

class Home extends React.Component {
  render() {
    return (
      <div>
        <Navigation />
        <ArticlesContainer />
        <Footer />
      </div>
    );
  }
}

export default Home;
